import { Dimensions } from 'react-native';
import { StyleSheet, flex } from 'react-native'

const windowWidth = Dimensions.get("window").width;
const windowHeight = Dimensions.get("window").height;



const StylesNottifys = StyleSheet.create({
    scrollView: {
  
      marginHorizontal: 0,
    },
    text: {
      fontSize: 25,
      paddingTop: 20,
    },
    view: {
      height: "100%",
      width: "100%",
    },
    
    touch: {
      height: 80,
      flex: 1,
      alignItems: "center",
      flexDirection: 'column'
  
    },
    viewhead: {
      flex: 1,
      display: flex,
      flexDirection: 'row',
      height: '100%',
      width: '100%',
      paddingBottom: 20,
  
    },
    viewScroll: {
      flex: 10,
      display: flex,
  
      height: '100%',
      width: '100%',
    },
    viewNagivator: {
      flex: 2,
      display: flex,
  
      height: '100%',
      width: '100%',
    }
  });

  export default StylesNottifys
